import React from 'react'
import { Switch, Route } from 'react-router-dom'
import Home from '../Component'

export default function () {
    return (
        <>
            <Switch>
                <Route path='/' exact component={Home} />
                <Route path='/home' exact component={Home} />
            </Switch>
        </>
    )
}
